import { FlatList } from "react-native-web";
import TodoList from "./TodoList";


export default function TodoLists (props) {
    return (
      <FlatList
        data={props.data}
        renderItem={({ item }) => <TodoList item={item} delete={props.delete} navigation={props.navigation} />}
      />
    )
  }
